import styled from 'styled-components';

const Application = styled.div`
  position: fixed;
  border: 1px solid black;
  display: flex;
  flex-direction: column;
  height: 95%;
  width: 100%;
`;

const App = () => {
  return (
    <Application>
      Harrison Lau
    </Application>

  )
}

export default App;
